// Header.js

import React from 'react';
import Sidebar from './Sidebar';
import logo from '../logoo.svg';

/**
 * Renders the header component with the given references and scroll function.
 *
 * @param {Object} homeRef - reference to the home section
 * @param {Object} aboutRef - reference to the about section
 * @param {Object} contactRef - reference to the contact section
 * @param {Function} scrollToSection - function to scroll to a specific section
 * @return {JSX.Element} the rendered header component
 */
const Header = ({ homeRef, aboutRef, contactRef, scrollToSection }) => {
  return (
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <Sidebar
        homeRef={homeRef}
        aboutRef={aboutRef}
        contactRef={contactRef}
        scrollToSection={scrollToSection}
      />
    </header>
  );
};

export default Header;
